import Layout from "../components/Layout";

export default function MyApp({ Component, pageProps }) {
  return (
    <SupabaseContextProvider client={supabase}>
      <StudiosProvider>
        {/* <ChakraProvider theme={theme}> */}
        <Layout>
          <Component {...pageProps} />
        </Layout>
        {/* </ChakraProvider> */}
      </StudiosProvider>
    </SupabaseContextProvider>
  );
}
